import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
const CourseList = () => {
	const type = 'teacher';
	const data = [
		{
			kurs: 'cloud computing',
		},
		{
			kurs: 'bulut bilişim',
		},
	];
	const columns = [
		{
			title: 'Course',
			dataIndex: 'kurs',
		},
		{
			title: 'Actions',
			render: (text) => {
				<Space size='middle'>
					<Link to={'courses/exams'}>
						<Button>List Exams</Button>
					</Link>
				</Space>;
				{
					type === 'teacher' && (
						<Space size='middle'>
							<Link to={'/dashboard/students'}>
								<Button>Add Student</Button>
							</Link>
							<Link to={'/courses/exam'}>
								<Button>Create Exam</Button>
							</Link>
						</Space>
					);
				}
			},
		},
	];
	return <Table dataSource={data} columns={columns} />;
};
export default CourseList;
